provisions.content:
Artículo único.- Cámbiase el nombre de las calles de las nuevas poblaciones de la ciudad de Castro, en la forma que a continuación se señala:
a) El de "Avenida Pacífico" por el de "Almirante Galvarino Riveros";
b) El de "Diagonal Norte" por el de "Diagonal Presidente Ibáñez";
c) El de "Avenida Norte a Sur" por el de "Intendente Arturo García";
d) Los de "Pasajes Sur Poniente" y "Pasaje 5 Oriente" por el de "Calle General Baquedano";
e) el de "Pasaje 3 Oriente" por el de "Calle Camilo Henríquez";
f) El de la calle "3 Sur" por el de "Guerrillero Manuel Rodríguez";
g) El de la calle "5 Poniente" por el de "Edmundo Pérez Zujovic";
h) El de "Pasaje 1 Poniente" por el de "Calle Alcalde Felipe Montiel";
i) El de "Pasaje 2 Poniente" por el de "Calle Alcalde Antonio González";
j) el de "Pasaje 3 Poniente" por el de "Calle Alcalde Tulio Alvarado";
k) El de "Pasaje 4 Poniente" por el de "Calle Profesor Juan Pérez";
l) El de "Pasaje 4 Oriente" por el de "Calle Doctor Manuel González";
m) El de "Pasaje 7 Oriente" por el de "Calle Bombero Armando Barría";
n) El de "Pasaje 8 Oriente" por el de "Calle Profesor Pedro Bahamonde";
ñ) El de "Pasaje 9 Oriente" por el de calle "Bombero Francisco Silva";
o) El de "Pasaje 1 Sur" por el calle Padre Manuel Cárcamo", y
p) El de "Pasaje 1 Norte" por el de "Calle Bombero Eduardo Ballesteros".".
